import { Injectable } from '@angular/core';
import { Fruit } from './fruit';
import { of, Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  private allFruits: Array<Fruit> = [
    {
      id: 1,
      name: 'Mango (Alphonso)',
      // tslint:disable-next-line:max-line-length
      sampleImage: 'data:image/jpeg;base64,',
      price: ['2kg - Rs.450', '1kg - Rs.250', '500gm - Rs.150'],
      seller: 'indiamart',
      foodValue: { calorie: '99Cal', carbohydrates: '25g', fat: '1g', fiber: '3g', suger: '23g', protien: '1g' }
    },
    {
      id: 2,
      name: 'Orange',
      // tslint:disable-next-line:max-line-length
      sampleImage: 'data:image/jpeg;base64,',
      price: ['1kg - Rs.82'],
      seller: 'grofer',
      foodValue: { protien: '0.9g', calorie: '47cal', suger: '9.4g', fiber: '2.4g', fat: '0.1g', carbohydrates: '11.8g' }
    },
    {
      id: 3,
      name: 'Watermelon',
      // tslint:disable-next-line:max-line-length
      sampleImage: 'data:image/jpeg;base64,',
      price: ['Rs.35/kg'],
      seller: 'grofer',
      foodValue: { protien: '0.6g', calorie: '30cal', suger: '6.2g', fiber: '0.4g', fat: '0.2g', carbohydrates: '7.6g' }
    }
  ];
  constructor() { }

  getFruitsForThumbnail(): Observable<Array<Fruit>> {
    return of(this.allFruits.map(x => ({ id: x.id, name: x.name, price: x.price, sampleImage: x.sampleImage } as Fruit)));
  }

  getFruitDetails(id: number): Observable<Fruit> {
    return of(this.allFruits.find(x => x.id === id));
  }
}
